            "about_project_text": "La cartographie de l'emplacement des sources et l'évaluation de la qualité de l'eau ont pour but d'aider les scientifiques et les institutions gouvernementales à recueillir de nouvelles informations. De cette manière, les données obtenues aident à gérer et à protéger la ressource en eau. Sans votre contribution, cela ne serait pas possible !",
            "springs": "Sources",
            "why_study_springs": "Pourquoi étudier les sources ?",
            "why_study_springs_text": "L'eau de bonne qualité est une ressource de plus en plus rare dans le monde. Nous devons tenir compte du fait que la plupart de l'eau sur Terre est saline (~97%) et que l'eau douce liquide ne représente qu'environ 0,8% de la quantité totale de l'eau sur Terre. La plupart de l'eau douce se présente sous la forme d'eau souterraine. Les sources sont les flux sortants naturels des eaux souterraines et constituent donc un élément important du cycle de l'eau. En Estonie et en Lettonie, la situation au niveau des ressources en eau est encore assez bonne, mais le changement climatique et les activités humaines intensives (par exemple : l'utilisation des pesticides et fertilisants en agriculture, le creusement de fossés, l'exploitation minière, etc) laissent des traces sur la disponnibilité et la qualité de d'eau.",
            "what_is_spring": "Qu'est ce qu'une source ?",
